import React from 'react';

const Navigation =({isSignedIn,onRouteChange})=>
{
	return(
	<nav className='tr'>
	<p onClick={() => onRouteChange('signin')} className='f3 link dim black underline pa3 pointer'> Sign Out </p>
	</nav>
    );
}

export default Navigation;
